use county_readmission;

CREATE TABLE measures (
                          Year INT,
                          County VARCHAR(255),
                          Average_age DECIMAL(5,2),
                          Medical DECIMAL(5,2),
                          Medicare DECIMAL(5,2),
                          Heart_Attack DECIMAL(5,2),
                          Cancer DECIMAL(5,2),
                          Diabetes DECIMAL(5,2),
                          Kidney DECIMAL(5,2),
                          Inpatient DECIMAL(6,2),
                          PRIMARY KEY (Year, County)
);

-- Create primary_admissions table
CREATE TABLE primary_admissions (
                                    Year INT,
                                    County VARCHAR(255),
                                    Total_Admits INT,
                                    30_day_Readmits INT,
                                    30_day_Readmission_Rate DECIMAL(5,2),
                                    FOREIGN KEY (Year, County) REFERENCES measures(Year, County)
);

-- Inserting data into measures table





-- Inserting values now into primary_admissions


SELECT m.Year, m.County, m.Average_age, m.Medical, m.Medicare, m.Heart_Attack, m.Cancer, m.Diabetes, m.Kidney, m.Inpatient, p.Total_Admits, p.30_day_Readmits, p.30_day_Readmission_Rate
FROM measures m LEFT JOIN primary_admissions p ON m.Year = p.Year AND m.County = p.County;
